    private void BgoActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_BgoActionPerformed
        SimpleDateFormat dateFormat = new SimpleDateFormat("dd/MM/yyyy");       //take the Date
        dt = dateFormat.format(date.getDate());
        if (!ShortFunction.DateInBetween(Syear, dt, Eyear)) {
            JLabel label = new JLabel("Please Select Valid Dates");
            label.setFont(new Font("Arial", Font.BOLD, 18));
            JOptionPane.showMessageDialog(null, label, "ERROR", JOptionPane.WARNING_MESSAGE);
            date.requestFocus();
            return;
        }
        DefaultTableModel dm = (DefaultTableModel) table.getModel();             //To Clear all existing Data
        dm.getDataVector().removeAllElements();
        dm.fireTableDataChanged();

//####################################################################################################################################
        // Item Stock Balance
        Scanner out;
        String Pstck;
        float netstck = (float) 00.0;
        String irate, iEname, iHname, ists;
        double Amt;
        float totalb = (float) 000.0;

        try {
            out = new Scanner(new File(ITMadd + "/item.txt"), "UTF-8");
            while (out.hasNext()) {
                String icode = out.nextLine();                                  //Read item Code
//####################################################################################################################################                        
                //Now read Rate
                Scanner ir = new Scanner(new File(ITMadd + "/" + icode + "/profile.txt"), "UTF-8");
                ir.nextLine();
                iEname = ir.nextLine();
                iHname = ir.nextLine();
                irate = ir.nextLine();
                ists = ir.nextLine();
                ir.close();
//####################################################################################################################################                        
                // Now read the stock of this item
                Pstck = "00.0";
                netstck = (float) 0;
                File tmp;
                int counter = 0;
                boolean dg;
                Scanner in;
                String tdt = ShortFunction.NamingDate(dt);
                for (; counter < 60; tdt = ShortFunction.Date_minus(tdt), counter++) {
                    tmp = new File(ITMadd + "/" + icode + "/Status/" + ShortFunction.NamingDateName(tdt) + ".txt");
                    dg = tmp.exists();
                    if (dg) {
                        break;
                    }
                }
                tmp = new File(ITMadd + "/" + icode + "/Status/" + ShortFunction.NamingDateName(tdt) + ".txt");
                dg = tmp.exists();
                if (dg) {
                    // ////TextIO.putln(ITMadd+"/"+icode+"/Status/"+ShortFunction.NamingDateName(tdt)+".txt");
                    in = new Scanner(tmp, "UTF-8");
                    in.useDelimiter(",|\\n");
                    Pstck = in.nextLine();
                    //////TextIO.putln(Pstck);
                    in.nextLine();
                    while (in.hasNext()) {
                        String datee = in.next();
                        if (ShortFunction.DateInBetween(ShortFunction.NamingDate(tdt), datee, dt)) {
                            in.next();
                            String str = in.next();
                            netstck += Float.valueOf(str);
                            if (Float.valueOf(str) > 0) {
                                irate = in.next();
                            }
                        }
                        in.nextLine();
                    }

                    netstck += Float.valueOf(Pstck);

                } else {

                    netstck = (float) 00.0;
                }

                Amt = (double) (netstck) * Float.valueOf(irate);
                totalb += Amt;

                DefaultTableModel model = (DefaultTableModel) table.getModel();
                String s1 = String.format("%.02f", netstck);
                String s2 = String.format("%.02f", netstck - Float.valueOf(ists));
                String s3 = String.format("%.01f", Amt);
                if (lang.compareToIgnoreCase("English") != 0) {
                    model.addRow(new Object[]{table.getRowCount() + 1, iHname, ists, s1, s2, irate, s3});
                } else {
                    model.addRow(new Object[]{table.getRowCount() + 1, iEname, ists, s1, s2, irate, s3});
                }
                total.setText(String.valueOf(totalb));
//####################################################################################################################################                        
            }

        } catch (FileNotFoundException ex) {
            JLabel label = new JLabel("Item item. !!! Error0015");
            label.setFont(new Font("Arial", Font.BOLD, 18));
            JOptionPane.showMessageDialog(this, label, "ERROR", JOptionPane.WARNING_MESSAGE);

        }
//####################################################################################################################################        

    }//GEN-LAST:event_BgoActionPerformed
