    private void tableKeyPressed(java.awt.event.KeyEvent evt) {//GEN-FIRST:event_tableKeyPressed
        int row = table.getSelectedRow(), col = table.getSelectedColumn();
        if (evt.getKeyCode() == KeyEvent.VK_E) {

            int roww;

            TableModel tm = table.getModel();
            Object o;
            int trr = table.getRowCount();
            //________________________

            if (row >= 0) {
                ////TextIO.putln("Inside >0");
                roww = table.getSelectedRow();
                erow = roww;
                o = tm.getValueAt(roww, 1);
                //o= table.getValueAt(roww, 1);
                final String iname = (String) o;
                o = tm.getValueAt(roww, 2);
                ists = (String) o;
                o = tm.getValueAt(roww, 3);
                final String qty = (String) o;
                o = tm.getValueAt(roww, 5);
                // icode.setText((String)o);
                String rate = (String) o;
                prate = Float.valueOf(rate);
                ename.setText(iname);
                eqty.setText(qty);
                erate.setText(rate);
                pamt = Float.valueOf(qty) * Float.valueOf(rate);
                eamt.setText(String.valueOf(Float.valueOf(qty) * Float.valueOf(rate)));
                ////TextIO.putln(iname+"\t"+qty+"\t"+rate);
                erate.requestFocus();
            }

        }


    }//GEN-LAST:event_tableKeyPressed

    private void srcKeyReleased(java.awt.event.KeyEvent evt) {//GEN-FIRST:event_srcKeyReleased
        final DefaultTableModel model = (DefaultTableModel) table.getModel();
        final TableModel tm = table.getModel();
        int t = table.getRowCount();

//table.scrollRectToVisible(null);
        //table.clearSelection();
        //System.out.println("RowCount:"+t);
        String tb;
        int i = 0;
        tb = src.getText();

        //top.setText("1"+tb);
        if (!tb.isEmpty()) {
            int k = evt.getKeyCode();
            if (k == 10) {
                i = table.getSelectedRow();
                //System.out.println("Eneter is Pressed::"+i);
                for (++i; i < t; ++i) {
                    //System.out.println("i="+i);
                    //tb=src.getText();
                    //top.setText("3"+tb);
                    String n = (String) tm.getValueAt(i, 0);
                    n = n.toUpperCase();
                    tb = tb.toUpperCase();
                    //System.out.println("tb="+tb+"   n="+n);
                    if (n.contains(tb)) {
                        //System.out.println("yes:"+tb+":::"+i);
                        table.setRowSelectionInterval(i, i);
                        table.getSelectionModel().setSelectionInterval(i, i);
                        table.scrollRectToVisible(new Rectangle(table.getCellRect(i + 5, 0, true)));
                        break;
                        //table.selectAll();
                    } else {

                        table.clearSelection();

                    }

                }
                if (i == t) {
                    table.setRowSelectionInterval(0, 0);
                    table.getSelectionModel().setSelectionInterval(0, 0);
                    table.scrollRectToVisible(new Rectangle(table.getCellRect(0, 0, true)));
                    table.clearSelection();
                }
            } else {
                table.setRowSelectionInterval(0, 0);
                table.getSelectionModel().setSelectionInterval(0, 0);
                table.scrollRectToVisible(new Rectangle(table.getCellRect(0, 0, true)));
                table.clearSelection();
                //tb=src.getText();
                //top.setText("2"+tb);
                i = table.getSelectedRow();
                for (++i; i < t; ++i) {
                    //tb=src.getText();
                    //top.setText("3"+i);
                    String n = (String) tm.getValueAt(i, 0);
                    n = n.toUpperCase();
                    tb = tb.toUpperCase();
                    //System.out.println("tb="+tb+"   n="+n);
                    if (n.contains(tb)) {
                        //System.out.println("yes:"+tb+":::"+i);
                        table.setRowSelectionInterval(i, i);
                        table.getSelectionModel().setSelectionInterval(i, i);
                        table.scrollRectToVisible(new Rectangle(table.getCellRect(i + 5, 0, true)));
                        break;
                        //table.selectAll();
                    } else {

                        table.clearSelection();
                        //System.out.println("nulli:"+table.getSelectedRow());
                        //src.requestFocus();
                        //table.setRowSelectionInterval(3, 3);
                    }

                }
                if (i == t) {
                    table.setRowSelectionInterval(0, 0);
                    table.getSelectionModel().setSelectionInterval(0, 0);
                    table.scrollRectToVisible(new Rectangle(table.getCellRect(0, 0, true)));
                    table.clearSelection();
                }
            }
        }
    }//GEN-LAST:event_srcKeyReleased

